import '../Css/PolicyStyle.css'
const Policy=()=>{
    return(
        <>
        <div className="policy">
            <h1>Kebijakan Privasi</h1>
            <ol>
        <li>Kebijakan Privasi ini menjelaskan:</li>
        <br>• Informasi apa yang kami kumpulkan dan mengapa kami kumpulkan.</br>
        <br>• Bagaimana kami menggunakan informasi itu.</br>
        <li>• Pilihan yang kami tawarkan, termasuk cara mengakses dan memperbarui informasi.</li>
        <li></li>
     
       
            </ol>
        </div>
       
        </>
    )
}
export default Policy;
